import jQuery from 'jquery'

window.onload = function() {
    if (window.jQuery) {  
        // jQuery is loaded  
        alert("Yeah!");
        jQuery(this).height();
    } else {
        // jQuery is not loaded
        alert("Doesn't Work");
    }
}
